import React from "react";
import { FiSearch } from "react-icons/fi";
const Header = () => {
  return (
    <div className=" w-full  text-white fixed z-10 bg-gray-700 py-5">
      <div className="font-bold pl-3  ">
        <div className="flex items-center">
          <div className="  w-20 ">MyPass</div>
          <div className="flex justify-start items-center">
            <textarea className=" rounded-sm">ページ内検索</textarea>
            <FiSearch size={30} className=" pl-1 bg-white text-gray-600" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
